module.exports = {"setting":{"title":"表格","category":"组件","order":89,"sidebar":"doc"},"catalogs":[],"contents":"<h1 id='header-%E5%B1%9E%E6%80%A7'>属性</h1><h2 id='header-Table'>Table</h2><div class=\"k-table-wrapper k-border\">\n                    <table class=\"k-table\">\n                        <thead><tr>\n<th>属性</th>\n<th>说明</th>\n<th>类型</th>\n<th>默认值</th>\n</tr>\n</thead>\n                        <tbody><tr>\n<td>data</td>\n<td>表格数据</td>\n<td><code>Array</code></td>\n<td><code>[]</code></td>\n</tr>\n<tr>\n<td>scheme</td>\n<td>定义表格结构：表头，单元格内容</td>\n<td><code>Object</code></td>\n<td><code>{}</code></td>\n</tr>\n<tr>\n<td>checkType</td>\n<td>当行可选择时，定义选择的类型: 单选 <code>&quot;radio&quot;</code> , 复选 <code>&quot;checkbox&quot;</code>, 不可选<code>&quot;none&quot;</code></td>\n<td><code>&quot;checkbox&quot;</code> &#124; <code>&quot;radio&quot;</code> &#124; <code>&quot;none&quot;</code></td>\n<td><code>&quot;checkbox&quot;</code></td>\n</tr>\n<tr>\n<td>noDataTemplate</td>\n<td>当没有数据的时候展示的内容</td>\n<td><code>String</code> &#124; <code>vNode</code></td>\n<td><code>&quot;/(ㄒoㄒ)/~~ 没有找到亲要的数据哦~&quot;</code></td>\n</tr>\n<tr>\n<td>fixHeader</td>\n<td>表头固定，给定需要固定高度的具体数值，当超出改值时，展示滚动条</td>\n<td><code>Number</code></td>\n<td><code>false</code></td>\n</tr>\n<tr>\n<td>rowKey</td>\n<td>设置行的key</td>\n<td><code>Function</code></td>\n<td>function(value, index) {  return <code>index</code>; }</td>\n</tr>\n<tr>\n<td>checkedKeys</td>\n<td>通过<code>key</code>数组来指定哪些行被选中（针对多选）</td>\n<td><code>Array</code></td>\n<td><code>[]</code></td>\n</tr>\n<tr>\n<td>checkedKey</td>\n<td>通过<code>key</code>指定哪行被选中（针对单选）</td>\n<td><code>String</code></td>\n<td><code>undefined</code></td>\n</tr>\n<tr>\n<td>resizable</td>\n<td>是否可以表头拖动</td>\n<td><code>Boolean</code></td>\n<td><code>false</code></td>\n</tr>\n<tr>\n<td>rowCheckable</td>\n<td>当行可选时，是否点击该行任意区域都可选中</td>\n<td><code>Boolean</code></td>\n<td><code>true</code></td>\n</tr>\n<tr>\n<td>rowClassName</td>\n<td>通过一个函数定义行的<code>className</code>，该函数会传入该行数据和索引当做参数，返回的字符串将被设为该行<code>className</code></td>\n<td><code>Function</code></td>\n<td><code>function(value, index) {  }</code></td>\n</tr>\n<tr>\n<td>disableRow</td>\n<td>定义行禁用可选的逻辑，返回<code>true</code>，则改行被禁用选择</td>\n<td><code>Function</code></td>\n<td><code>function(data, index) { return false }</code></td>\n</tr>\n<tr>\n<td>rowExpandable</td>\n<td>是否点击改行任意区域即展开</td>\n<td><code>Boolean</code></td>\n<td><code>true</code></td>\n</tr>\n<tr>\n<td>expand</td>\n<td>通过函数指定行展开后要展示的模板内容</td>\n<td><code>Function</code></td>\n<td><code>undefined</code></td>\n</tr>\n<tr>\n<td>expandedKeys</td>\n<td>通过<code>key</code>来指定哪些行展开</td>\n<td><code>Array</code></td>\n<td><code>[]</code></td>\n</tr>\n<tr>\n<td>type</td>\n<td>表格类型，默认左右无边框，<code>&quot;border&quot;</code>类型会添加边框</td>\n<td><code>&quot;default&quot;</code> &#124; <code>&quot;border&quot;</code></td>\n<td><code>&quot;default&quot;</code></td>\n</tr>\n<tr>\n<td>sort</td>\n<td>排序，详见示例说明</td>\n<td><code>Object</code></td>\n<td><code>{}</code></td>\n</tr>\n<tr>\n<td>group</td>\n<td>分组，详见示例说明</td>\n<td><code>Object</code></td>\n<td><code>{}</code></td>\n</tr>\n<tr>\n<td>minColWidth</td>\n<td>指定所有列拖动时的最小宽度</td>\n<td><code>Number</code></td>\n<td><code>40</code></td>\n</tr>\n</tbody>\n                    </table>\n                </div><h2 id='header-TableColumn'>TableColumn</h2><p>除了通过<code>Table</code>的<code>scheme</code>属性指定表格的结构外，还以通过<code>TableColumn</code>来指定，它的属性值跟<code>scheme</code>数据结构一一对应</p>\n<div class=\"k-table-wrapper k-border\">\n                    <table class=\"k-table\">\n                        <thead><tr>\n<th>属性</th>\n<th>说明</th>\n<th>类型</th>\n<th>默认值</th>\n</tr>\n</thead>\n                        <tbody><tr>\n<td>title</td>\n<td>标题</td>\n<td><code>String</code></td>\n<td><code>&quot;&quot;</code></td>\n</tr>\n<tr>\n<td>template</td>\n<td>指定当前列，单元格渲染模板函数</td>\n<td><code>Function</code></td>\n<td><code>(data, index) =&gt; {}</code>,</td>\n</tr>\n<tr>\n<td>key</td>\n<td>指定当前列的<code>key</code>，<strong>必须指定，并且为了保证顺序正确，不要以数字开头</strong></td>\n<td><code>String</code></td>\n<td><code>&quot;&quot;</code></td>\n</tr>\n<tr>\n<td>sortable</td>\n<td>是否可排序</td>\n<td><code>Boolean</code></td>\n<td><code>false</code></td>\n</tr>\n<tr>\n<td>width</td>\n<td>列宽，可以指定百分比或像素(像素不需要加单位)</td>\n<td><code>String</code></td>\n<td><code>undefined</code></td>\n</tr>\n<tr>\n<td>group</td>\n<td>指定分组数组，每一项格式为<code>{value: &#39;选中后的值&#39;, label: &#39;展示的文案&#39;}</code></td>\n<td><code>Array&lt;Object&gt;</code></td>\n<td><code>undefined</code></td>\n</tr>\n<tr>\n<td>multiple</td>\n<td>分组是否支持多选</td>\n<td><code>Boolean</code></td>\n<td><code>false</code></td>\n</tr>\n<tr>\n<td>minWidth</td>\n<td>指定当前列拖动时的最小宽度，优先级高于<code>Table</code>的<code>minColWidth</code></td>\n<td><code>Number</code></td>\n<td><code>40</code></td>\n</tr>\n</tbody>\n                    </table>\n                </div><h1 id='header-%E6%89%A9%E5%B1%95%E7%82%B9'>扩展点</h1><h2 id='header-Table'>Table</h2><div class=\"k-table-wrapper k-border\">\n                    <table class=\"k-table\">\n                        <thead><tr>\n<th>名称</th>\n<th>说明</th>\n</tr>\n</thead>\n                        <tbody><tr>\n<td>no-data</td>\n<td>自定义无数据展示模板</td>\n</tr>\n</tbody>\n                    </table>\n                </div><h2 id='header-TableColumn'>TableColumn</h2><div class=\"k-table-wrapper k-border\">\n                    <table class=\"k-table\">\n                        <thead><tr>\n<th>名称</th>\n<th>说明</th>\n</tr>\n</thead>\n                        <tbody><tr>\n<td>title</td>\n<td>自定义复杂表头内容</td>\n</tr>\n</tbody>\n                    </table>\n                </div><h1 id='header-%E6%96%B9%E6%B3%95'>方法</h1><h2 id='header-Table'>Table</h2><div class=\"k-table-wrapper k-border\">\n                    <table class=\"k-table\">\n                        <thead><tr>\n<th>方法名</th>\n<th>说明</th>\n<th>参数</th>\n<th>返回值</th>\n</tr>\n</thead>\n                        <tbody><tr>\n<td>getCheckedData</td>\n<td>获取选中数据信息</td>\n<td>-</td>\n<td><code>Array</code></td>\n</tr>\n<tr>\n<td>checkAll</td>\n<td>全部选中</td>\n<td>-</td>\n<td><code>undefined</code></td>\n</tr>\n<tr>\n<td>uncheckAll</td>\n<td>全不选中</td>\n<td>-</td>\n<td><code>undefined</code></td>\n</tr>\n<tr>\n<td>isCheckAll</td>\n<td>判断是否全选</td>\n<td>-</td>\n<td><code>Boolean</code></td>\n</tr>\n<tr>\n<td>isChecked</td>\n<td>判断某行是否选中</td>\n<td><code>key</code></td>\n<td><code>Boolean</code></td>\n</tr>\n<tr>\n<td>checkRow</td>\n<td>选中某行</td>\n<td><code>key</code></td>\n<td><code>undefined</code></td>\n</tr>\n<tr>\n<td>uncheckRow</td>\n<td>取消选中某行</td>\n<td><code>key</code></td>\n<td><code>undefined</code></td>\n</tr>\n<tr>\n<td>expandRow</td>\n<td>展开某行</td>\n<td><code>key</code></td>\n<td><code>undefined</code></td>\n</tr>\n<tr>\n<td>shrinkRow</td>\n<td>收起某行</td>\n<td><code>key</code></td>\n<td><code>undefined</code></td>\n</tr>\n</tbody>\n                    </table>\n                </div><h1 id='header-%E4%BA%8B%E4%BB%B6'>事件</h1><h2 id='header-Table'>Table</h2><div class=\"k-table-wrapper k-border\">\n                    <table class=\"k-table\">\n                        <thead><tr>\n<th>事件名</th>\n<th>说明</th>\n<th>参数</th>\n</tr>\n</thead>\n                        <tbody><tr>\n<td>$change:checked</td>\n<td>选中的数据变化会触发的事件</td>\n<td><code>instance, newValue, oldValue</code></td>\n</tr>\n</tbody>\n                    </table>\n                </div>","index":139}

