module.exports = {"setting":{"title":"快速开始","order":0,"sidebar":"doc"},"catalogs":[],"contents":"<h1 id='header-%E5%87%86%E5%A4%87%E5%B7%A5%E4%BD%9C'>准备工作</h1><p>在学习使用kpc之前，假设你已经掌握了以下知识：</p>\n<ol>\n<li><a href=\"https://webpack.js.org/\">webpack</a> + <a href=\"https://babeljs.io/\">babel</a></li>\n<li><a href=\"https://cn.vuejs.org/index.html\">vue</a>（如果将kpc用于vue项目）或者<a href=\"http://javey.github.io/intact/\">intact</a>（如果将kpc用于intact项目）</li>\n</ol>\n<h1 id='header-%E4%BD%BF%E7%94%A8%E8%84%9A%E6%89%8B%E6%9E%B6'>使用脚手架</h1><p>使用<a href=\"http://yeoman.io/\">Yeoman</a>以及generator-kscpm，可以快速初始化kpc项目</p>\n<ol>\n<li>安装yo和generator-kscpm</li>\n</ol>\n<pre><code class=\"hljs shell\">npm <span class=\"hljs-keyword\">install</span> -g yo generator-kscpm\n</code></pre>\n<ol start=\"2\">\n<li>初始化kpc项目</li>\n</ol>\n<p>kscpm提供了很多工程模板，用于初始化项目，页面以及组件等</p>\n<pre><code class=\"hljs shell\"><span class=\"hljs-string\">yo</span> <span class=\"hljs-string\">kscpm</span> <span class=\"hljs-comment\"># 列出所有可选工程模板</span>\n<span class=\"hljs-string\">yo</span> <span class=\"hljs-attr\">kscpm:intact</span> <span class=\"hljs-comment\"># 初始化基于intact的kpc项目</span>\n<span class=\"hljs-string\">yo</span> <span class=\"hljs-attr\">kscpm:vue</span> <span class=\"hljs-comment\"># 初始化基于vue的kpc项目</span>\n\n<span class=\"hljs-string\">...</span>\n</code></pre>\n<ol start=\"3\">\n<li>启动项目</li>\n</ol>\n<pre><code class=\"hljs shell\">npm <span class=\"hljs-keyword\">run</span><span class=\"bash\"> dev</span>\n</code></pre>\n<h1 id='header-%E6%89%8B%E5%8A%A8%E5%BC%95%E5%85%A5'>手动引入</h1><h2 id='header-%E5%8D%95%E6%96%87%E4%BB%B6%E6%9E%84%E5%BB%BA%E7%89%88'>单文件构建版</h2><p>如果你的项目没有使用webpack来构建，可以引入单文件构建版。将<code>kpc.css</code>和<code>kpc.js</code>在html文件中引入。此时所有组件都在<code>Kpc</code>命名空间下，例如<code>Kpc.Button</code> <code>Kpc.Table</code>等。</p>\n<p>另外你也可以调用<code>Kpc.install</code>方法将组件放到全局空间下，此时为了避免命名冲突，所有组件名前加上<code>K</code>作为前缀，例如<code>KButton</code> <code>KTable</code>等</p>\n<pre><code class=\"hljs html\"><span class=\"hljs-meta\">&lt;!doctype html&gt;</span>\n<span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">html</span>&gt;</span>\n<span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">head</span>&gt;</span>\n    <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">meta</span> <span class=\"hljs-attr\">charset</span>=<span class=\"hljs-string\">\"utf-8\"</span> /&gt;</span>\n    <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">title</span>&gt;</span>kpc-demo<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">title</span>&gt;</span>\n    <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">link</span> <span class=\"hljs-attr\">rel</span>=<span class=\"hljs-string\">\"stylesheet\"</span> <span class=\"hljs-attr\">type</span>=<span class=\"hljs-string\">\"text/css\"</span> <span class=\"hljs-attr\">href</span>=<span class=\"hljs-string\">\"node_modules/kpc/dist/kpc.css\"</span> /&gt;</span>\n<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">head</span>&gt;</span>\n<span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">body</span>&gt;</span>\n    <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">div</span> <span class=\"hljs-attr\">id</span>=<span class=\"hljs-string\">\"app\"</span>&gt;</span><span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">div</span>&gt;</span>\n\n    <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">script</span> <span class=\"hljs-attr\">type</span>=<span class=\"hljs-string\">\"text/javascript\"</span> <span class=\"hljs-attr\">src</span>=<span class=\"hljs-string\">\"node_modules/intact/dist/intact.js\"</span>&gt;</span><span class=\"undefined\"></span><span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">script</span>&gt;</span>\n    <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">script</span> <span class=\"hljs-attr\">type</span>=<span class=\"hljs-string\">\"text/javascript\"</span> <span class=\"hljs-attr\">src</span>=<span class=\"hljs-string\">\"node_modules/kpc/dist/kpc.js\"</span>&gt;</span><span class=\"undefined\"></span><span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">script</span>&gt;</span>\n    <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">script</span> <span class=\"hljs-attr\">type</span>=<span class=\"hljs-string\">\"text/javascript\"</span>&gt;</span><span class=\"javascript\">\n        Kpc.install();\n        <span class=\"hljs-keyword\">var</span> Page = Intact.extend({\n            <span class=\"hljs-attr\">template</span>: <span class=\"hljs-string\">'&lt;KButton ev-click={self.hello}&gt;Hello World&lt;/KButton&gt;'</span>,\n            <span class=\"hljs-attr\">hello</span>: <span class=\"hljs-function\"><span class=\"hljs-keyword\">function</span>(<span class=\"hljs-params\"></span>) </span>{\n                KMessage.success(<span class=\"hljs-string\">'Welcome to kpc world!'</span>);\n            }\n        });\n        Intact.mount(Page, <span class=\"hljs-built_in\">document</span>.getElementById(<span class=\"hljs-string\">'app'</span>));\n    </span><span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">script</span>&gt;</span>\n<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">body</span>&gt;</span>\n<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">html</span>&gt;</span>\n</code></pre>\n<blockquote>\n<p>kpc样式需要加载字体文件，默认字体文件放在目录<code>./fonts</code>下，你可能需要根据实际情况修改该路径</p>\n</blockquote>\n<h2 id='header-%E5%A4%9A%E6%96%87%E4%BB%B6%E6%9E%84%E5%BB%BA%E7%89%88'>多文件构建版</h2><p>当项目使用webpack构建时，可以使用kpc的多文件构建版，此时可以做到按需加载，而非单文件全量引入。多文件构建版样式css和字体，需要通过<code>css-loader &amp; style-loader</code>和<code>file-loader</code>来引入</p>\n<ol>\n<li>安装依赖</li>\n</ol>\n<pre><code class=\"hljs shell\">npm <span class=\"hljs-keyword\">install</span> intact kpc <span class=\"hljs-comment\">--save</span>\n\nnpm <span class=\"hljs-keyword\">install</span> css-loader <span class=\"hljs-keyword\">style</span>-loader <span class=\"hljs-keyword\">file</span>-loader <span class=\"hljs-comment\">--save-dev</span>\n</code></pre>\n<ol start=\"2\">\n<li>配置<code>webpack.config.js</code></li>\n</ol>\n<p>为了统一组件加载路径，我们可以加入<code>alias</code>设置。例如：<code>kpc/components/button</code>会指向<code>kpc/@css/components/button</code></p>\n<pre><code class=\"hljs js\"><span class=\"hljs-string\">const</span> <span class=\"hljs-string\">path</span> <span class=\"hljs-string\">=</span> <span class=\"hljs-string\">require('path');</span>\n\n<span class=\"hljs-string\">module.exports</span> <span class=\"hljs-string\">=</span> <span class=\"hljs-string\">{</span>\n    <span class=\"hljs-string\">...</span>\n<span class=\"hljs-attr\">    resolve:</span> <span class=\"hljs-string\">{</span>\n<span class=\"hljs-attr\">        alias:</span> <span class=\"hljs-string\">{</span>\n            <span class=\"hljs-string\">//</span> <span class=\"hljs-string\">让kpc组件指向多文件构建版本，可以统一组件加载路径</span>\n<span class=\"hljs-attr\">            'kpc':</span> <span class=\"hljs-string\">path.resolve(__dirname,</span> <span class=\"hljs-string\">'./node_modules/kpc/@css'</span><span class=\"hljs-string\">)</span>\n        <span class=\"hljs-string\">}</span>\n    <span class=\"hljs-string\">},</span>\n<span class=\"hljs-attr\">    module:</span> <span class=\"hljs-string\">{</span>\n<span class=\"hljs-attr\">        rules:</span> <span class=\"hljs-string\">[</span>\n            <span class=\"hljs-string\">{</span>\n<span class=\"hljs-attr\">                test:</span> <span class=\"hljs-string\">/\\.css$/,</span>\n<span class=\"hljs-attr\">                use:</span> <span class=\"hljs-string\">[</span>\n                    <span class=\"hljs-string\">{</span>\n<span class=\"hljs-attr\">                        loader:</span> <span class=\"hljs-string\">'style-loader'</span><span class=\"hljs-string\">,</span>\n                    <span class=\"hljs-string\">},</span>\n                    <span class=\"hljs-string\">{</span>\n<span class=\"hljs-attr\">                        loader:</span> <span class=\"hljs-string\">'css-loader'</span><span class=\"hljs-string\">,</span>\n<span class=\"hljs-attr\">                        options:</span> <span class=\"hljs-string\">{</span>\n<span class=\"hljs-attr\">                            url:</span> <span class=\"hljs-literal\">true</span>\n                        <span class=\"hljs-string\">}</span>\n                    <span class=\"hljs-string\">}</span>\n                <span class=\"hljs-string\">]</span>\n            <span class=\"hljs-string\">},</span>\n            <span class=\"hljs-string\">//</span> <span class=\"hljs-string\">引入字体文件</span>\n            <span class=\"hljs-string\">{</span>\n<span class=\"hljs-attr\">                test:</span> <span class=\"hljs-string\">/\\.(woff2?|eot|ttf|otf|svg)(\\?.*)?$/,</span>\n<span class=\"hljs-attr\">                use:</span> <span class=\"hljs-string\">[</span>\n                    <span class=\"hljs-string\">{</span>\n<span class=\"hljs-attr\">                        loader:</span> <span class=\"hljs-string\">'file-loader'</span><span class=\"hljs-string\">,</span>\n<span class=\"hljs-attr\">                        options:</span> <span class=\"hljs-string\">{</span>\n<span class=\"hljs-attr\">                            outputPath:</span> <span class=\"hljs-string\">'./fonts/'</span><span class=\"hljs-string\">,</span>\n                        <span class=\"hljs-string\">}</span>\n                    <span class=\"hljs-string\">}</span>\n                <span class=\"hljs-string\">]</span>\n            <span class=\"hljs-string\">},</span>\n        <span class=\"hljs-string\">]</span>\n    <span class=\"hljs-string\">}</span>\n<span class=\"hljs-string\">}</span>\n</code></pre>\n<ol start=\"3\">\n<li>按需引入组件</li>\n</ol>\n<p>在需要使用组件的地方，引入组件</p>\n<pre><code class=\"hljs js\"><span class=\"hljs-keyword\">import</span> {Button, ButtonGroup} <span class=\"hljs-keyword\">from</span> <span class=\"hljs-string\">'kpc/components/button'</span>;\n\n<span class=\"xml\"><span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">ButtonGroup</span>&gt;</span>\n    <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">Button</span>&gt;</span>button1<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">Button</span>&gt;</span>\n    <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">Button</span>&gt;</span>button2<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">Button</span>&gt;</span>\n<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">ButtonGroup</span>&gt;</span></span>\n</code></pre>\n<h2 id='header-%E5%A4%9A%E6%96%87%E4%BB%B6%E5%8D%8A%E6%9E%84%E5%BB%BA%E7%89%88'>多文件半构建版</h2><p>所谓半构建版与构建版的区别是，样式使用的<code>stylus</code>而非编译后的css。当我们需要修改或者引入新主题时，通过该版本，可以很方便地实现。详见<a href=\"\">定制主题</a></p>\n<p>由于使用<code>stylus</code>，所以与构建版在使用上唯一的区别是需要引入<code>stylus-loader</code></p>\n<ol>\n<li>新增依赖</li>\n</ol>\n<p>为了提供css兼容性，这里加入<code>autoprefixer</code></p>\n<pre><code class=\"hljs shell\">npm install postcss-loader autoprefixer stylus-loader --<span class=\"hljs-built_in\">save</span>-<span class=\"hljs-built_in\">dev</span>\n</code></pre>\n<ol start=\"2\">\n<li>修改<code>webpack.config.js</code></li>\n</ol>\n<p>将css加载配置修改为（通过<code>stylus-loader</code>的<code>import</code>配置，我们可以引入主题文件）：</p>\n<pre><code class=\"hljs js\"><span class=\"hljs-string\">const</span> <span class=\"hljs-string\">path</span> <span class=\"hljs-string\">=</span> <span class=\"hljs-string\">require('path');</span>\n\n<span class=\"hljs-string\">module.export</span> <span class=\"hljs-string\">=</span> <span class=\"hljs-string\">{</span>\n    <span class=\"hljs-string\">...</span>\n<span class=\"hljs-attr\">    resolve:</span> <span class=\"hljs-string\">{</span>\n<span class=\"hljs-attr\">        alias:</span> <span class=\"hljs-string\">{</span>\n<span class=\"hljs-attr\">            'kpc':</span> <span class=\"hljs-string\">path.resolve(__dirname,</span> <span class=\"hljs-string\">'./node_modules/kpc/@stylus'</span><span class=\"hljs-string\">)</span>\n        <span class=\"hljs-string\">}</span>\n    <span class=\"hljs-string\">},</span>\n<span class=\"hljs-attr\">    module:</span> <span class=\"hljs-string\">{</span>\n<span class=\"hljs-attr\">        rules:</span> <span class=\"hljs-string\">[</span>\n            <span class=\"hljs-string\">...</span>\n            <span class=\"hljs-string\">//</span> <span class=\"hljs-string\">编译stylus</span>\n            <span class=\"hljs-string\">{</span>\n<span class=\"hljs-attr\">                test:</span> <span class=\"hljs-string\">/\\.(styl|css)$/,</span>\n<span class=\"hljs-attr\">                use:</span> <span class=\"hljs-string\">[</span>\n                    <span class=\"hljs-string\">{</span>\n<span class=\"hljs-attr\">                        loader:</span> <span class=\"hljs-string\">'css-loader'</span><span class=\"hljs-string\">,</span> \n<span class=\"hljs-attr\">                        options:</span> <span class=\"hljs-string\">{</span>\n<span class=\"hljs-attr\">                            url:</span> <span class=\"hljs-literal\">true</span><span class=\"hljs-string\">,</span>\n                        <span class=\"hljs-string\">}</span>\n                    <span class=\"hljs-string\">},</span>\n                    <span class=\"hljs-string\">{</span>\n<span class=\"hljs-attr\">                        loader:</span> <span class=\"hljs-string\">'postcss-loader'</span><span class=\"hljs-string\">,</span>\n<span class=\"hljs-attr\">                        options:</span> <span class=\"hljs-string\">{</span>\n<span class=\"hljs-attr\">                            plugins:</span> <span class=\"hljs-string\">[</span>\n                                <span class=\"hljs-string\">autoprefixer({</span>\n<span class=\"hljs-attr\">                                    browsers:</span> <span class=\"hljs-string\">[</span>\n                                        <span class=\"hljs-string\">'last 2 versions'</span><span class=\"hljs-string\">,</span>\n                                        <span class=\"hljs-string\">'ie &gt;= 9'</span><span class=\"hljs-string\">,</span>\n                                    <span class=\"hljs-string\">],</span>\n                                <span class=\"hljs-string\">})</span>\n                            <span class=\"hljs-string\">],</span>\n                        <span class=\"hljs-string\">}</span>\n                    <span class=\"hljs-string\">},</span>\n                    <span class=\"hljs-string\">{</span>\n<span class=\"hljs-attr\">                        loader:</span> <span class=\"hljs-string\">'stylus-loader'</span><span class=\"hljs-string\">,</span> \n<span class=\"hljs-attr\">                        options:</span> <span class=\"hljs-string\">{</span>\n                            <span class=\"hljs-string\">'include css'</span><span class=\"hljs-string\">:</span> <span class=\"hljs-literal\">true</span><span class=\"hljs-string\">,</span>\n<span class=\"hljs-attr\">                            sourceMap:</span> <span class=\"hljs-literal\">false</span><span class=\"hljs-string\">,</span>\n                            <span class=\"hljs-string\">//</span> <span class=\"hljs-string\">使用import引入主题文件，详见定制主题</span>\n                            <span class=\"hljs-string\">//</span> <span class=\"hljs-string\">'import'</span><span class=\"hljs-string\">:</span> <span class=\"hljs-string\">path.resolve(__dirname,</span> <span class=\"hljs-string\">'styles/themes/ksyun/index.styl'</span><span class=\"hljs-string\">),</span>\n                        <span class=\"hljs-string\">}</span>\n                    <span class=\"hljs-string\">}</span>\n                <span class=\"hljs-string\">]</span>\n            <span class=\"hljs-string\">}</span>\n        <span class=\"hljs-string\">]</span>\n    <span class=\"hljs-string\">}</span>\n<span class=\"hljs-string\">}</span>\n</code></pre>\n","index":2}

